SET CLIENT_ENCODING TO UTF8;
SET STANDARD_CONFORMING_STRINGS TO ON;
BEGIN;
CREATE TABLE "hospitals" (gid serial PRIMARY KEY,
"status" varchar(1),
"score" int4,
"side" varchar(1),
"x" numeric,
"y" numeric,
"arc_street" varchar(60),
"yr" numeric,
"hname" varchar(254),
"hstreet" varchar(254),
"hcity" varchar(254),
"hstate" varchar(254),
"hzip" varchar(254),
"hcounty" numeric,
"trauma_lev" int4,
"trauma_typ" varchar(12));
SELECT AddGeometryColumn('','hospitals','the_geom','4326','POINT',2);
CREATE INDEX "hospitals_the_geom_gist" ON "hospitals" using gist ("the_geom" gist_geometry_ops);
COMMIT;
